CREATE TABLE ride (
  trip_date VARCHAR(255), city_id INTEGER, trip_id INTEGER, passenger_id INTEGER, driver_id VARCHAR(255), pickup_location VARCHAR(255), dropoff_location VARCHAR(255), requested_at TIMESTAMP, pair_requested_at TIMESTAMP, passengercancelled_at TIMESTAMP, driver_arrived_at TIMESTAMP, started_trip_at TIMESTAMP, ended_trip_at TIMESTAMP, current_state VARCHAR(255), payment_type VARCHAR(255)
);


SELECT * FROM ride;
SELECT requested_at + INTERVAL '3 hours'
FROM ride;
